import Formulario from '../assets/images/logo.svg'

const Form = () => {
    return (
        <View style={styles.container}>
            <ImageBackground style={styles.background} source={Formulario}>
                <Text></Text>
            </ImageBackground>

        </View>
    )
}

export default Form

const styles = StyleSheet.create({

